import React from "react";
import { Route, Switch, useRouteMatch } from "react-router-dom";
import Footer from "./Footer";
import CurrentOrdersList from "./Order/CurrentOrdersList";
import NewOrdersList from "./Order/NewOrdersList";

export default function Dashboard(){
    let { path } = useRouteMatch();
    return (
        <div className="d-flex flex-column justify-content-end w-100" style={{height: "100vh"}}>
            <div className="p-2" style={{flex: 1, overflow: "auto"}}>
                <Switch>
                    <Route path={`${path}/wallet`} component={NewOrdersList} />
                    <Route path={`${path}/settings`} component={NewOrdersList} />
                    <Route path={`${path}`} component={CurrentOrdersList} />
                </Switch>
            </div>
            <Footer />
        </div>
    )
}
